This is my contribution for the 3D artis mag design your own Pet Monster competition. For a while now I have been able to loan an Ultimaker 3d printer for just the weekend. This made me realize how much I could use a machine like this all the time.
//PET TOASTER<br />
This little guy is my Pet TOASTER. With its adorable bread ears and knob eyes it is monstrously cute.
